import * as React from "react";
import { TextTile as TextTileProps } from "../model";

export default function TextTile({
  elementKey,
  color,
  title,
  text,
}: TextTileProps) {
  return (
    <div id={elementKey} style={{ backgroundColor: color }}>
      <h2>{title}</h2>
      <textarea>{text}</textarea>
    </div>
  );
}
